import React, { useState } from 'react'

function FileUpLoad() {
    const [file, setFile] = useState();
    const handleFileChange = (event) => {
        setFile(...event)
    }
  return (
    <form>
        <h2>Upload image</h2>
        <input type="file" onChange={handleFileChange} multiple />
    </form>
  )
}

export default FileUpLoad
